import './stylesheets/App.scss';
import logo from './assets/images/logo.svg';


function App() {
  return (
    <div className="App">
        <appheader/>
    </div>
  );
}

export default App;


export const appheader =()=>{
  return(
    <header>
        <div className='container'>
          <div className='header-wrapper'>
              <img src={logo}/>
          </div>
        </div>
    </header>
  )
}
